import React from 'react';
import Sidebar from './Sidebar'; // Sidebar Component
import InfoCard from './InfoCard'; // InfoCard Component
import { FaUsers, FaChalkboardTeacher, FaRoute, FaBuilding } from 'react-icons/fa'; // Icons
import styles from './CoordinatorDashboard.module.css';

const Dashboard = () => {
  const dummyData = [
    { title: 'Advisors', value: 34, icon: <FaUsers />, bgColor: '#6C63FF' },
    { title: 'Guides', value: 53, icon: <FaChalkboardTeacher />, bgColor: '#FF6584' },
    { title: 'Tours', value: 49, icon: <FaRoute />, bgColor: '#FFCC29' },
    { title: 'Fairs', value: 9, icon: <FaBuilding />, bgColor: '#3DBE29' },
  ];

  return (
    <div className={styles.dashboard}>
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className={styles.mainContent}>
        <h1 className={styles.dashboardTitle}>Dashboard</h1>

        {/* InfoCards Section */}
        <div className={styles.infoCardsContainer}>
          {dummyData.map((data, index) => (
            <InfoCard
              key={index}
              title={data.title}
              value={data.value}
              icon={data.icon}
              bgColor={data.bgColor}
            />
          ))}
        </div>

        {/* Placeholder for other components */}
        <div className={styles.extraContent}>
          <p>More content will go here...</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
